; Print with color

printC macro msg
    local msgloop_AHF
    push_all
    msgloop_AHF:
    mov ah,9 ;Display
    mov bh,0 ;Page 0
    mov di,offset msg
    mov al,[di]
    mov cx,1h ;1 time
    mov bl,70h ;grey (A) on black(F) background
    INC DI
    int 10h
    cmp [di],'$'
    jnz msgloop_AHF
    pop_all  
endm printC

readmsg macro msg
    mov ah,0ah
    mov dx,offset msg
    int 21h
endm readmsg

